// DATA Files
import dataNavbar from "data/Navbar/main-navbar-data.json";
// Components
import { HeaderOne, ContactOne } from 'webapp/common'

const WorkRegister = () => {
  return (
    <>
      <HeaderOne data={dataNavbar} />
      <section
        className={"dark-bg pt-0 pb-0 transition-none "}
        id="contact"
      >
      </section>
    </>
  )
}

export default WorkRegister
